function seedDB() {
  Campground.remove({}, function(err) {
    if (err) {
      console.log(err);
    }
    console.log("removed campgrounds!");
  });

  //add a few campgrounds => 데이터를 뭉텅이로 넣을 때 forEach로 개별로 보내야한다.
  data.forEach(function(seed) {
    Campground.create(seed, function(err, campground) {
      if (err) {
        console.log(err);
      } else {
        console.log("added a campground");
        //create a comment
        Comment.create(
          {
            text: "This place is great, but I wish there was internet",
            author: "Homer"
          },
          function(err, comment) {
            if (err) {
              console.log(err);
            } else {
              //campground내에 reference 하고 있는 comment라는 collection에다가 방금 추가한 comment를 추가해주자.
              campground.comments.push(comment); //재밌는 점은 밖에 새로운 collection이 생김.
              campground.save();
              console.log("Created new comment");
            }
          }
        );
      }
    });
  });

  //add a few comments
}

module.exports = seedDB;
